import styled from "styled-components";

export const Header = styled.div`
  width: 1440px;
  height: 128px;
  border: 1px solid #c2c2c2;
  border-radius: 12px;
  margin: auto;
  border-radius: 12px 12px 0px 0px;
  display: flex;

  .iconArea {
    width: 283px;
    height: inherit;
    background-color: #6e74f8;
  }

  .headerInfo {
    width: 1157px;
  }
`;

export const Container = styled.div`
  display: flex;
  width: 1440px;
  height: 1024px;
  border: 1px solid #c2c2c2;
  border-radius: 12px 0px 0px 0px;
  margin: auto;

  .sideMenu {
    width: 237px;
    height: inherit;
    background-color: #6e74f8;
    display: flex;
    flex-direction: column;
    align-items: center;
    padding: 23px;
    color: #ffffff;

    .menuIcons .icon {
      margin-bottom: 30px;
      width: 66px;
      height: 50px;
      display: flex;
      color: red;
      flex-direction: column;
    }
  }
  .containerContent {
  }
`;
